import React, { Component, Fragment} from 'react'
import Link from 'next/link';

import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
import IconButton from '@material-ui/core/IconButton'
import FormControlLabel from '@material-ui/core/FormControlLabel'
import Checkbox from '@material-ui/core/Checkbox'

import VisibilityIcon from '@material-ui/icons/Visibility'
import FavoriteIcon from '@material-ui/icons/Favorite'
import FavoriteBorderIcon from '@material-ui/icons/FavoriteBorder'


class fridgeMagnets extends Component {

  constructor(props)
  {
    super(props)
  }

  render() {

    return (
      <div>
        <Grid container justify="center" alignItems="baseline">
          {(
          this.props.stores==null
            ?""
            :this.props.stores.map((store) => (
              <Paper elevation={3} style={{margin:"5px", paddingLeft:"15px", paddingRight:"15px", paddingTop:"0", paddingBottom:"0", position:'relative'}}>
                <p style={{maxWidth:"200px"}}><strong>{store.name}</strong></p>
                <p>
                  <small>{store.address}</small>
                  <FormControlLabel
                    control={
                      <Checkbox 
                        icon={<FavoriteIcon />} 
                        checkedIcon={<FavoriteIcon />} 
                        name="checkedH" 
                      />
                    }
                  />
                </p>
                <Link href="/about"><div style={{background:"black", position:"absolute", right:"0", bottom:"0", width:'10px', height:"10px" }}>test</div></Link>
              </Paper>
            ))
          )}
        </Grid>
      </div>
    )
  }
}

export default fridgeMagnets;
